import { useState } from "react";
import Banner from "../../components/player/Banner";
import data from "../../data.json"

const categoriList = data.pro["categoriList"];
const playersList = data["pro"].map((el)=> el.categori);

console.log(playersList);


export default function Pro () {

    const [isCategori,setIsCategori] = useState('전체');


    return(
        <>
          <Banner onBannerTab={'프로'} aniWidth={'50%'}/>
          <section className="size1442 proArea">
            <div>
                {categoriList.map((el,index) => <button className={isCategori === el ? 'active' : ''} onClick={() => setIsCategori(el)} key={index}>{el}</button>)}
            </div>

          </section>
        </>

    )
}
